import logo from './logo.svg';
import './App.css';

//HTML
//<img src='./logo.svg' class="App-logo" style='margin-bottom:20rem' />


//JSX
//<img src={logo} className="App-logo" style={{marginBottom:'20rem'}} alt="logo" />


const  theme = true


function App() {
  return (
    <div id='page' className={theme ? 'dark' : 'other'}>
      <header className="App-header">
        <img src={logo} className="App-logo"
          style={{
            marginBottom: 20
          }}
          alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
